import React from "react";
import { useNavigate } from "react-router-dom";

function CardPage() {
  const navigate = useNavigate();

  return (
    <div>
      <button
        className="back-button"
        onClick={() => {
          navigate("/models");
        }}
      ></button>
      <h2 className="popup__title">Настройки</h2>
    </div>
  );
}

export default CardPage;
